import React from 'react';
import './Article.css';

function Article() {
  return (
    <main className="article">
      <h2>Welcome to Wiki Demo</h2>
      <p>This is a demo page for a wiki-style layout built with React.</p>
      <p>Explore the sidebar to navigate through categories.</p>
    </main>
  );
}

export default Article;
